import styled from "styled-components";

const StyledHeader = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  z-index: 1;

  width: 100%;
  height: 45px;

  background: rgb(66, 255, 0, 0.6);

  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Header = () => {
  return <StyledHeader></StyledHeader>;
};

export default Header;
